<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>MOLYNEAUX BLACKBIRD | Cyberspace</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700;900&family=Rajdhani:wght@300;500;700&display=swap');
        
        * { margin: 0; padding: 0; box-sizing: border-box; }
        
        body {
            font-family: 'Rajdhani', sans-serif;
            background: #000;
            color: #0ff;
            overflow: hidden;
        }
        
        #container {
            width: 100vw;
            height: 100vh;
            position: relative;
        }
        
        /* Scanline overlay */
        #container::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: repeating-linear-gradient(
                0deg,
                rgba(0, 0, 0, 0.1) 0px,
                rgba(0, 0, 0, 0.1) 1px,
                transparent 1px,
                transparent 2px
            );
            pointer-events: none;
            z-index: 1000;
        }
        
        /* Vignette */
        #container::after {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: radial-gradient(ellipse at center, transparent 40%, rgba(0,0,0,0.8) 100%);
            pointer-events: none;
            z-index: 999;
        }
        
        #hud-top {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            padding: 20px 30px;
            background: linear-gradient(180deg, rgba(0,20,40,0.9) 0%, transparent 100%);
            z-index: 100;
            display: flex;
            justify-content: space-between;
            align-items: flex-start;
        }
        
        #title-block {
            position: relative;
        }
        
        #title {
            font-family: 'Orbitron', monospace;
            font-size: 2.2em;
            font-weight: 900;
            letter-spacing: 0.15em;
            text-transform: uppercase;
            color: #0ff;
            text-shadow: 
                0 0 10px #0ff,
                0 0 20px #0ff,
                0 0 40px #08f,
                0 0 80px #08f;
            animation: flicker 4s infinite;
        }
        
        @keyframes flicker {
            0%, 95%, 100% { opacity: 1; }
            96% { opacity: 0.8; }
            97% { opacity: 1; }
            98% { opacity: 0.9; }
        }
        
        #subtitle {
            font-family: 'Rajdhani', sans-serif;
            font-size: 0.9em;
            font-weight: 300;
            letter-spacing: 0.4em;
            text-transform: uppercase;
            color: #08f;
            margin-top: 5px;
        }
        
        #data-readout {
            font-family: 'Orbitron', monospace;
            font-size: 0.75em;
            color: #0f8;
            text-align: right;
            line-height: 1.8;
        }
        
        .data-row {
            opacity: 0.8;
        }
        
        .data-value {
            color: #0ff;
            font-weight: 700;
        }
        
        #controls {
            position: absolute;
            bottom: 30px;
            left: 50%;
            transform: translateX(-50%);
            display: flex;
            gap: 20px;
            align-items: center;
            background: rgba(0, 20, 40, 0.8);
            border: 1px solid #0ff;
            box-shadow: 
                0 0 20px rgba(0,255,255,0.3),
                inset 0 0 20px rgba(0,255,255,0.1);
            padding: 15px 30px;
            border-radius: 5px;
            z-index: 100;
        }
        
        .cyber-btn {
            width: 50px;
            height: 50px;
            border: 2px solid #0ff;
            background: transparent;
            color: #0ff;
            font-size: 1.3em;
            cursor: pointer;
            transition: all 0.2s ease;
            clip-path: polygon(10% 0%, 90% 0%, 100% 10%, 100% 90%, 90% 100%, 10% 100%, 0% 90%, 0% 10%);
            display: flex;
            align-items: center;
            justify-content: center;
        }
        
        .cyber-btn:hover {
            background: rgba(0,255,255,0.2);
            box-shadow: 0 0 20px #0ff;
            text-shadow: 0 0 10px #0ff;
        }
        
        .cyber-btn.active {
            background: rgba(0,255,255,0.3);
            box-shadow: 0 0 30px #0ff;
        }
        
        #timeline {
            width: 250px;
            height: 8px;
            -webkit-appearance: none;
            background: rgba(0,255,255,0.2);
            border: 1px solid #0ff;
            cursor: pointer;
        }
        
        #timeline::-webkit-slider-thumb {
            -webkit-appearance: none;
            width: 20px;
            height: 20px;
            background: #0ff;
            cursor: pointer;
            box-shadow: 0 0 15px #0ff;
            clip-path: polygon(50% 0%, 100% 50%, 50% 100%, 0% 50%);
        }
        
        #time-display {
            font-family: 'Orbitron', monospace;
            font-size: 1em;
            color: #0ff;
            min-width: 100px;
            text-align: center;
            text-shadow: 0 0 10px #0ff;
        }
        
        #view-controls {
            position: absolute;
            top: 100px;
            left: 20px;
            display: flex;
            flex-direction: column;
            gap: 8px;
            z-index: 100;
        }
        
        .view-btn {
            padding: 10px 20px;
            background: rgba(0, 20, 40, 0.8);
            border: 1px solid #08f;
            color: #0ff;
            font-family: 'Rajdhani', sans-serif;
            font-size: 0.85em;
            font-weight: 500;
            letter-spacing: 0.15em;
            text-transform: uppercase;
            cursor: pointer;
            transition: all 0.2s ease;
            clip-path: polygon(0% 0%, 95% 0%, 100% 50%, 95% 100%, 0% 100%);
        }
        
        .view-btn:hover, .view-btn.active {
            background: rgba(0,255,255,0.2);
            border-color: #0ff;
            box-shadow: 0 0 15px rgba(0,255,255,0.5);
        }
        
        #style-controls {
            position: absolute;
            top: 100px;
            right: 20px;
            display: flex;
            flex-direction: column;
            gap: 8px;
            z-index: 100;
        }
        
        .style-btn {
            padding: 8px 16px;
            background: rgba(0, 20, 40, 0.6);
            border: 1px solid #f0f;
            color: #f0f;
            font-family: 'Rajdhani', sans-serif;
            font-size: 0.8em;
            letter-spacing: 0.1em;
            cursor: pointer;
            transition: all 0.2s ease;
        }
        
        .style-btn:hover, .style-btn.active {
            background: rgba(255,0,255,0.2);
            box-shadow: 0 0 15px rgba(255,0,255,0.5);
        }
        
        #loading {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-family: 'Orbitron', monospace;
            font-size: 1.5em;
            color: #0ff;
            text-shadow: 0 0 20px #0ff;
            animation: pulse 1s infinite;
        }
        
        @keyframes pulse {
            0%, 100% { opacity: 1; }
            50% { opacity: 0.5; }
        }
        
        .hidden { display: none !important; }
    </style>
</head>

            // Head/Neck
            neck: { joints: ['upperChest', 'neck'], radius: 0.05, color: 0xff00ff },
            head: { joint: 'head', radius: 0.10, color: 0xff00ff, isHead: true },
            // Left Arm
            leftUpperArm: { joints: ['leftShoulder', 'leftArm'], radius: 0.045, color: 0x00ffaa },
            leftForearm: { joints: ['leftArm', 'leftForeArm'], radius: 0.04, color: 0x00ffaa },
            leftHandPart: { joints: ['leftForeArm', 'leftHand'], radius: 0.035, color: 0x00ff88 },
            // Right Arm
            rightUpperArm: { joints: ['rightShoulder', 'rightArm'], radius: 0.045, color: 0x00ffaa },
            rightForearm: { joints: ['rightArm', 'rightForeArm'], radius: 0.04, color: 0x00ffaa },
            rightHandPart: { joints: ['rightForeArm', 'rightHand'], radius: 0.035, color: 0x00ff88 },
            // Left Leg
            leftThigh: { joints: ['leftUpLeg', 'leftLeg'], radius: 0.07, color: 0xff00aa },
            leftShin: { joints: ['leftLeg', 'leftFoot'], radius: 0.05, color: 0xff00aa },
            leftFootPart: { joints: ['leftFoot', 'leftToe'], radius: 0.04, color: 0xff0088 },
            // Right Leg
            rightThigh: { joints: ['rightUpLeg', 'rightLeg'], radius: 0.07, color: 0xff00aa },
            rightShin: { joints: ['rightLeg', 'rightFoot'], radius: 0.05, color: 0xff00aa },
            rightFootPart: { joints: ['rightFoot', 'rightToe'], radius: 0.04, color: 0xff0088 },
        };
        
        const bodyParts = {};
        Object.entries(bodyDefs).forEach(([name, def]) => {
            const geo = new THREE.SphereGeometry(def.radius, 16, 16);
            const mat = new THREE.MeshStandardMaterial({
                color: def.color,
                metalness: 0.8,
                roughness: 0.2,
                emissive: def.color,
                emissiveIntensity: 0.3,
                transparent: true,
                opacity: 0.9
            });
            const mesh = new THREE.Mesh(geo, mat);
            mesh.visible = false;
            scene.add(mesh);
            bodyParts[name] = { mesh, def };
        });
        
        // ============ MATRIX RAIN CHARACTERS ============
        const matrixChars = [];
        const matrixCharCount = 100;
        const matrixFont = 'bold 14px monospace';
        
        for (let i = 0; i < matrixCharCount; i++) {
            const canvas = document.createElement('canvas');
            canvas.width = 32;
            canvas.height = 32;
            const ctx = canvas.getContext('2d');
            
            const texture = new THREE.CanvasTexture(canvas);
            const mat = new THREE.SpriteMaterial({
                map: texture,
                transparent: true,
                blending: THREE.AdditiveBlending
            });
            const sprite = new THREE.Sprite(mat);
            sprite.scale.set(0.15, 0.15, 1);
            sprite.position.set(
                (Math.random() - 0.5) * 10,
                Math.random() * 8,
                (Math.random() - 0.5) * 10
            );
            sprite.userData = {
                canvas, ctx, texture,
                speed: 0.02 + Math.random() * 0.05,
                char: String.fromCharCode(0x30A0 + Math.random() * 96),
                brightness: Math.random()
            };
            sprite.visible = false;
            scene.add(sprite);
            matrixChars.push(sprite);
        }
        
        function updateMatrixChars() {
            matrixChars.forEach(sprite => {
                if (!sprite.visible) return;
                
                sprite.position.y -= sprite.userData.speed;
                if (sprite.position.y < 0) {
                    sprite.position.y = 8;
                    sprite.position.x = (Math.random() - 0.5) * 10;
                    sprite.position.z = (Math.random() - 0.5) * 10;
                    sprite.userData.char = String.fromCharCode(0x30A0 + Math.random() * 96);
                }
                
                // Update character
                const { canvas, ctx, texture, brightness } = sprite.userData;
                ctx.clearRect(0, 0, 32, 32);
                ctx.fillStyle = `rgba(0, ${Math.floor(200 + brightness * 55)}, ${Math.floor(brightness * 100)}, ${0.5 + brightness * 0.5})`;
                ctx.font = matrixFont;
                ctx.textAlign = 'center';
                ctx.textBaseline = 'middle';
                ctx.fillText(sprite.userData.char, 16, 16);
                texture.needsUpdate = true;
                
                // Random character change
                if (Math.random() < 0.02) {
                    sprite.userData.char = String.fromCharCode(0x30A0 + Math.random() * 96);
                }
            });
        }
        
        // Joint spheres with glow
        const jointMeshes = {};
        const jointGlows = {};
        
        jointNames.forEach((name, i) => {
            // Core sphere
            const geo = new THREE.SphereGeometry(0.025, 16, 16);
            const mat = new THREE.MeshBasicMaterial({
                color: 0x00ffff,
                transparent: true,
                opacity: 0.9
            });
            const mesh = new THREE.Mesh(geo, mat);
            scene.add(mesh);
            jointMeshes[name] = mesh;
            
            // Glow sphere
            const glowGeo = new THREE.SphereGeometry(0.04, 16, 16);
            const glowMat = new THREE.MeshBasicMaterial({
                color: 0x00ffff,
                transparent: true,
                opacity: 0.3,
                blending: THREE.AdditiveBlending
            });
            const glow = new THREE.Mesh(glowGeo, glowMat);
            scene.add(glow);
            jointGlows[name] = glow;
        });
        
        // Bone connections
        const boneMeshes = [];
        skeletonConnections.forEach(([from, to]) => {
            const mat = new THREE.LineBasicMaterial({
                color: 0x00ffff,
                transparent: true,
                opacity: 0.8,
                blending: THREE.AdditiveBlending
            });
            const geo = new THREE.BufferGeometry();
            geo.setAttribute('position', new THREE.BufferAttribute(new Float32Array(6), 3));
            const line = new THREE.Line(geo, mat);
            scene.add(line);
            boneMeshes.push({ line, from, to });
        });
        
        // Energy trails
        const trailLength = 30;
        const trailJoints = ['leftHand', 'rightHand', 'leftFoot', 'rightFoot', 'head'];
        const trails = {};
        
        trailJoints.forEach(name => {
            const positions = new Float32Array(trailLength * 3);
            const geo = new THREE.BufferGeometry();
            geo.setAttribute('position', new THREE.BufferAttribute(positions, 3));
            
            const mat = new THREE.LineBasicMaterial({
                color: name.includes('Hand') ? 0xff00ff : 0x00ffff,
                transparent: true,
                opacity: 0.6,
                blending: THREE.AdditiveBlending
            });
            const line = new THREE.Line(geo, mat);
            scene.add(line);
            trails[name] = { line, geo, history: [] };
        });
        
        // ============ STATE ============
        let currentFrame = 0;
        let isPlaying = false;
        let lastTime = 0;
        let displayStyle = 'hologram';
        let cameraMode = 'orbit';
        let orbitAngle = 0;
        
        let isDragging = false;
        let prevMouse = { x: 0, y: 0 };
        let spherical = { radius: 4, theta: 0, phi: Math.PI / 3 };
        
        // ============ CAMERA ============
        const cameraPresets = {
            front: { pos: [0, 1.2, 4], target: [0, 1, 0] },
            side: { pos: [4, 1.2, 0], target: [0, 1, 0] },
            top: { pos: [0, 6, 0.01], target: [0, 1, 0] },
        };
        
        function updateCamera() {
            if (cameraMode === 'orbit') {
                camera.position.x = spherical.radius * Math.sin(spherical.phi) * Math.sin(spherical.theta);
                camera.position.y = spherical.radius * Math.cos(spherical.phi) + 1;
                camera.position.z = spherical.radius * Math.sin(spherical.phi) * Math.cos(spherical.theta);
                camera.lookAt(0, 1, 0);
            } else if (cameraMode === 'cinematic') {
                orbitAngle += 0.008;
                camera.position.x = 4 * Math.sin(orbitAngle);
                camera.position.z = 4 * Math.cos(orbitAngle);
                camera.position.y = 1.5 + 0.5 * Math.sin(orbitAngle * 0.5);
                camera.lookAt(0, 1, 0);
            } else if (cameraPresets[cameraMode]) {
                const preset = cameraPresets[cameraMode];
                camera.position.set(...preset.pos);
                camera.lookAt(...preset.target);
            }
        }
        
        // ============ UPDATE FRAME ============
        function updateFrame() {
            const frame = frameData[currentFrame];
            const time = performance.now() * 0.001;
            
            const isHumanoid = displayStyle === 'humanoid';
            const isMatrix = displayStyle === 'matrix';
            const isHologram = displayStyle === 'hologram';
            const isWireframe = displayStyle === 'wireframe';
            const isParticles = displayStyle === 'particles';
            const isEnergy = displayStyle === 'energy';
            
            // Update joints
            jointNames.forEach(name => {
                if (frame[name] && jointMeshes[name]) {
                    const pos = frame[name];
                    jointMeshes[name].position.set(pos.x, pos.y, pos.z);
                    jointGlows[name].position.set(pos.x, pos.y, pos.z);
                    
                    // Pulse effect
                    const pulse = 1 + 0.2 * Math.sin(time * 5 + jointNames.indexOf(name));
                    jointGlows[name].scale.setScalar(pulse);
                    
                    // Visibility based on style
                    jointMeshes[name].visible = !isHumanoid && !isEnergy;
                    jointGlows[name].visible = isHologram || isEnergy || isMatrix;
                    
                    // Matrix style - green glow
                    if (isMatrix) {
                        jointGlows[name].material.color.setHex(0x00ff00);
                        jointMeshes[name].material.color.setHex(0x00ff00);
                    } else {
                        jointGlows[name].material.color.setHex(0x00ffff);
                        jointMeshes[name].material.color.setHex(0x00ffff);
                    }
                }
            });
            
            // Update humanoid body parts
            Object.entries(bodyParts).forEach(([name, { mesh, def }]) => {
                mesh.visible = isHumanoid;
                
                if (isHumanoid && def.joints) {
                    const [j1, j2] = def.joints;
                    if (frame[j1] && frame[j2]) {
                        const p1 = frame[j1];
                        const p2 = frame[j2];
                        
                        // Position at midpoint
                        mesh.position.set(
                            (p1.x + p2.x) / 2,
                            (p1.y + p2.y) / 2,
                            (p1.z + p2.z) / 2
                        );
                        
                        // Calculate direction and length
                        const dx = p2.x - p1.x;
                        const dy = p2.y - p1.y;
                        const dz = p2.z - p1.z;
                        const length = Math.sqrt(dx*dx + dy*dy + dz*dz);
                        
                        // Scale to fit between joints
                        mesh.scale.set(1, length / (def.radius * 2) + 1, 1);
                        
                        // Orient towards next joint
                        mesh.lookAt(p2.x, p2.y, p2.z);
                        mesh.rotateX(Math.PI / 2);
                    }
                } else if (isHumanoid && def.isHead && def.joint) {
                    if (frame[def.joint]) {
                        mesh.position.set(frame[def.joint].x, frame[def.joint].y, frame[def.joint].z);
                        mesh.scale.set(1, 1, 1);
                    }
                }
            });
            
            // Update bones
            boneMeshes.forEach(({ line, from, to }) => {
                if (frame[from] && frame[to]) {
                    const positions = line.geometry.attributes.position.array;
                    positions[0] = frame[from].x; positions[1] = frame[from].y; positions[2] = frame[from].z;
                    positions[3] = frame[to].x; positions[4] = frame[to].y; positions[5] = frame[to].z;
                    line.geometry.attributes.position.needsUpdate = true;
                    
                    // Matrix style - green bones
                    if (isMatrix) {
                        line.material.color.setHex(0x00ff00);
                    } else {
                        line.material.color.setHex(0x00ffff);
                    }
                }
                line.visible = !isParticles && !isHumanoid;
            });
            
            // Update trails
            trailJoints.forEach(name => {
                if (frame[name] && trails[name]) {
                    const trail = trails[name];
                    trail.history.unshift({ ...frame[name] });
                    if (trail.history.length > trailLength) trail.history.pop();
                    
                    const positions = trail.geo.attributes.position.array;
                    trail.history.forEach((p, i) => {
                        positions[i * 3] = p.x;
                        positions[i * 3 + 1] = p.y;
                        positions[i * 3 + 2] = p.z;
                    });
                    trail.geo.attributes.position.needsUpdate = true;
                    trail.geo.setDrawRange(0, trail.history.length);
                    trail.line.visible = isHologram || isEnergy || isHumanoid;
                    
                    // Matrix trails are green
                    if (isMatrix) {
                        trail.line.material.color.setHex(0x00ff00);
                    } else {
                        trail.line.material.color.setHex(name.includes('Hand') ? 0xff00ff : 0x00ffff);
                    }
                }
            });
            
            // Matrix rain visibility
            matrixChars.forEach(sprite => {
                sprite.visible = isMatrix;
            });
            
            // Update HUD
            document.getElementById('timeline').value = currentFrame;
            document.getElementById('frame-count').textContent = currentFrame + 1 + ' / ' + totalFrames;
            
            const totalSeconds = currentFrame / fps;
            const mins = Math.floor(totalSeconds / 60);
            const secs = Math.floor(totalSeconds % 60);
            const frames = Math.floor((totalSeconds % 1) * fps);
            const timeStr = mins.toString().padStart(2, '0') + ':' + 
                           secs.toString().padStart(2, '0') + ':' + 
                           frames.toString().padStart(2, '0');
            document.getElementById('time-code').textContent = timeStr;
            document.getElementById('time-display').textContent = timeStr;
        }
        
        // ============ ANIMATION LOOP ============
        function animate(time) {
            requestAnimationFrame(animate);
            
            // Animate environment
            particles.rotation.y += 0.0002;
            
            // Animate data streams
            streams.forEach(stream => {
                stream.material.opacity = 0.1 + 0.1 * Math.sin(time * 0.001 * stream.userData.speed + stream.userData.offset);
            });
            
            // Animate lights
            const t = time * 0.001;
            magentaLight.position.x = 3 * Math.cos(t * 0.5);
            magentaLight.position.z = 3 * Math.sin(t * 0.5);
            blueLight.position.x = -3 * Math.cos(t * 0.3);
            blueLight.position.z = -3 * Math.sin(t * 0.3);
            
            // Update matrix rain
            updateMatrixChars();
            
            // Playback
            if (isPlaying) {
                const elapsed = time - lastTime;
                if (elapsed >= 1000 / fps) {
                    currentFrame++;
                    if (currentFrame >= totalFrames) currentFrame = 0;
                    updateFrame();
                    lastTime = time;
                }
            }
            
            updateCamera();
            renderer.render(scene, camera);
        }
        
        // ============ EVENT LISTENERS ============
        document.getElementById('playBtn').addEventListener('click', function() {
            isPlaying = !isPlaying;
            this.textContent = isPlaying ? '⏸' : '▶';
            this.classList.toggle('active', isPlaying);
        });
        
        document.getElementById('rewindBtn').addEventListener('click', () => {
            currentFrame = Math.max(0, currentFrame - Math.floor(fps * 5));
            updateFrame();
        });
        
        document.getElementById('forwardBtn').addEventListener('click', () => {
            currentFrame = Math.min(totalFrames - 1, currentFrame + Math.floor(fps * 5));
            updateFrame();
        });
        
        const timeline = document.getElementById('timeline');
        timeline.max = totalFrames - 1;
        timeline.addEventListener('input', (e) => {
            currentFrame = parseInt(e.target.value);
            updateFrame();
        });
        
        document.querySelectorAll('.view-btn').forEach(btn => {
            btn.addEventListener('click', function() {
                document.querySelectorAll('.view-btn').forEach(b => b.classList.remove('active'));
                this.classList.add('active');
                cameraMode = this.dataset.camera;
            });
        });
        
        document.querySelectorAll('.style-btn').forEach(btn => {
            btn.addEventListener('click', function() {
                document.querySelectorAll('.style-btn').forEach(b => b.classList.remove('active'));
                this.classList.add('active');
                displayStyle = this.dataset.style;
                updateFrame();
            });
        });
        
        renderer.domElement.addEventListener('mousedown', (e) => {
            if (cameraMode === 'orbit') {
                isDragging = true;
                prevMouse = { x: e.clientX, y: e.clientY };
            }
        });
        
        window.addEventListener('mouseup', () => isDragging = false);
        
        window.addEventListener('mousemove', (e) => {
            if (isDragging && cameraMode === 'orbit') {
                const dx = e.clientX - prevMouse.x;
                const dy = e.clientY - prevMouse.y;
                spherical.theta += dx * 0.01;
                spherical.phi = Math.max(0.1, Math.min(Math.PI - 0.1, spherical.phi - dy * 0.01));
                prevMouse = { x: e.clientX, y: e.clientY };
            }
        });
        
        renderer.domElement.addEventListener('wheel', (e) => {
            if (cameraMode === 'orbit') {
                spherical.radius = Math.max(2, Math.min(15, spherical.radius + e.deltaY * 0.01));
            }
        });
        
        document.addEventListener('keydown', (e) => {
            if (e.code === 'Space') {
                e.preventDefault();
                document.getElementById('playBtn').click();
            }
        });
        
        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });
        
        // ============ INIT ============
        document.getElementById('loading').classList.add('hidden');
        updateFrame();
        animate(0);
    </script>
</body>
</html>
